import React from "react";

const Confirmation=(props)=>{
    const infoArr=[]
    let obj=props.data
    for(let key in obj){
        let info=
        <div>
            <h2>{key}<h3>{obj[key]['code']}</h3></h2>
            <h4> Population:{obj[key]['population']}</h4>
        </div>
        infoArr.push(info)
    }
    return(
        <div className="box">
            <h2>Did you mean:</h2>
                {infoArr}
            <button><a href="/calc">Yep, that's right!</a></button>
            <button><a href="/">No, I meant someplace else</a></button>
        </div>
    )
}

export default Confirmation
